/////This three needle pine recovers quickly after being trimmed or sheared and develops a mature dark green appearance in its third year. They have excellent needle retention if kept standing in water./////It has scale like foliage which during the summer season is a fresh medium green. It does not drop its foliage, does not droop and gives off an amazing fruity fragrance. It will last for a very long period after being cut if stood in water. However, the foliage will dry and turn brown if it remains un-watered and becomes dehydrated./////The best thing that we can recommend when caring for your Christmas tree is to imagine that it is a giant cut flower./////This three needle pine recovers quickly after being trimmed or sheared and develops a mature dark green appearance in its third year. They have excellent needle retention if kept standing in water./////It has scale like foliage which during the summer season is a fresh medium green. It does not drop its foliage, does not droop and gives off an amazing fruity fragrance. It will last for a very long period after being cut if stood in water. However, the foliage will dry and turn brown if it remains un-watered and becomes dehydrated./////When choosing your radiata Christmas tree you should choose one that has mature growth that cover the cut tips, which have a white appearance if trimmed too late in the season. You should also be wary of a tree that has light green immature growth as these tips wilt soon after cutting and no amount of watering will revive them./////There are many theories on adding different cocktails to the water but in our opinion the two most sound options are aspirin or common bleach. Aspirin contains oil of winter green which is a conifer derivative and is responsible for thinning the blood, it is possible that it also helps the tree drink water. Bleach on the other hand will help keep the water fresh and prevent it stagnating or breeding mosquitoes, but would have to be added to every top up of water the tree gets to be effective. Some of other suggestions we have been informed of are sugar, whiskey, gin, beer, milk, and plant food. They all may have their merits but I believe the best merit of all is they act as a prompt to give the tree water and one thing is for sure, no matter how good an additive is it won’t work without water.

